INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4366, 720, 'Clomipramine', 'Limited data suggest that the administration of clomipramine with grapefruit juice or cranberry juice may significantly increase plasma drug concentrations of clomipramine.  Clomipramine is initially demethylated by CYP450 1A2, 3A3 and 3A4 before undergoing further metabolism to 8-hydroxyclomipramine.  The increase in clomipramine bioavailability may stem from inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.  The precise mechanism by which cranberry juice exerts its effects is unknown, but may involve inhibition of CYP450 isoenzymes.  This interaction has occasionally been exploited in attempts to improve symptomatic control of obsessive compulsive disorder.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'789c4d8ec10dc3300c0357e1004167e90aaa4d272e6c3990ac14d9be06fae993e001774f99953a1dc6c47a55dd91dae8f534e9558979d0e4bcf13906d6499f4826faa2d98d77d4c40dfb22582ceaf40dc3fef68f801f235ac68be843eb1cc68cb240c917cd0996c2b41a4433427310a5459ab1da86faf2e26ce25d902d76345e6cfef802df21464d', NULL, X'');
