INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4384, 4293, 'Clidinium', 'Use of anticholinergic agents with alcohol may result in sufficient impairment of attention so as to render driving and operating machinery more hazardous.  In addition, the potential for abuse may be increased with the combination.  The mechanism of interaction is not established but may involve additive depressant effects on the central nervous system.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c358ddb11c2300c045bb90ad2031dd082b09558836283252793ee51207c6846afdbbd696aa529acb4a1190b57eea47ae0c1a0ad49e68c3cbad4055ee2f43ab08b175075491194f85f248122e93601777239db3f3138a98d6aac41f2f6838292cb26f169e8fc1ef215ac9123052977af6c8611123dbd079eb5ed285131195f3ad03c73f273b74e1f290b4be3', NULL, X'');